import React, { Component } from "react";
import "./form.css"
import {Row, Col} from "antd"

export default class UserForm extends Component {
  render() {
    return (
      <div>
        <Row gutter={[48, 48]}>
          <Col span={12} />
          <Col span={12} />

          <Col span={12} />
          <Col span={12} />
        </Row>
        <Row gutter={[48, 48]}>
          <Col span={12} />
          <Col span={12} />
        </Row>
      </div>
    );
  }
}
